import Link from "next/link";
import useSWR from "swr";
export default async function Index() {
  const { data, error } = await useSWR("./api/test.js", url =>
    fetch(url).then(r => r.json())
  );

  if (error) throw error;
  console.log(data);
  return (
    <>
      <h1>Response: {data}</h1>
      <Link href="/about">
        <a>Go to About!</a>
      </Link>
    </>
  );
}
